import React from "react";
import "./style.css";

const AboutPage = props => {
  return (
    <div className="about-page">
      <div className="about-title">
        <h2>About Me</h2>
      </div>

      <div className="about-text">
         <p>17+ years in the software industry with previous roles in product management, business analysis, and technical writing. </p>
         <p>        I've spent the past six months expanding my skills through a Coding Bootcamp with a focus on Full Stack Web Development. 
</p>
      </div>

      <div className="tech-icons">
      <i class="fab fa-html5 fa-3x"></i>
      <i class="fab fa-css3-alt fa-3x"></i>
      <i class="fab fa-js fa-3x"></i>
      <i class="fab fa-node-js fa-3x"></i>
      <i class="fab fa-react fa-3x"></i>
      <i class="fas fa-database fa-3x"></i>
      </div>
    </div>
  );
};

export default AboutPage;
